 ─ Bu üzerimde gördüğünüz kıyafetler canlı yayın gününden kalma. Yeni yükleme fırsatı buldum. Bunu her seferinde dediğimin farkındayım ve bu dediğimi lütfen bir bahane olarak görmeyin. Bugün sizlerin kalbini almaya geldim. 👀  Şimdi isterseniz biraz canlı yayından bahsedelim. İlk öncelikle cover yaptığım i love you 3000 şarkısının tam halini sizinle paylaşacağım. Bu şekilde beni affetmiş olursunuz, hm? Evet biliyordum reveluvs buna dayanamayaz... 🎉🎉 beni affettiğinize göre kaldığımız yerden devam edelim! Canlı yayında  Sm'de  doğum günüm için satılan kolyemi taktım. Bu yayında takmak için hızlı kargo istediğimi belirtmesem olmazdı. 🤡 Yayında espoir ve aveda promosyonlarını da yapmayı unutmadım. En yeni koleksiyonları yayında beraber denedik. Samsung Galaxy Note20 ile fotoğraf çekilmeyi ihmal etmedim. Ve Üyeler ile doğum günümde buluşamasakta hepsi bana uzunca mesajlar gönderdi. 🤧 onları cidden seviyorum. Uh, duygusallaşmadan konuyu değiştirelim. Yayında arayan sasaengler  yayın akışını bozsından dolayı rahatsız olsam da pek bu konu üstünde durmıcam. 🤡

